import React from "react";
import "./Footer.css";

const Footer = () => (
  <footer className="footer">
    <span>&copy; <span id="currentYear"></span> </span>
    <a href="https://logannitzsche.com">Logan Nitzsche</a>
  </footer>
);

export default Footer;
